import logo from './logo.svg';

import ExpenseItems from './components/ExpenseItems'
function App() {
  const expensee_data = [
    {
      id:'e1',
      title:'Car',
      amount: 202.02,
      date: new Date('2022-02-02')
    },
    {
      id:'e2',
      title:'Car1',
      amount: 201.02,
      date: new Date('2022-02-02')
    },
    {
      id:'e3',
      title:'Car3',
      amount: 2023.02,
      date: new Date('2022-02-02')
    },
    {
      id:'e14',
      title:'Car4',
      amount: 2024.402,
      date: new Date('2022-02-02')
    },
  ];
  return (
    <div>
      <h1>Hello world !!</h1>
      <ExpenseItems
      title={expensee_data[0].title} 
      amount={expensee_data[0].amount} 
      date={expensee_data[0].date} 
      />
    </div>
  );
}

export default App;
